import React, { useEffect, useState } from 'react';
import { useParams } from 'react-router-dom';

export function StateDetail() {
  const { id } = useParams();
  const [casa, setCasa] = useState(null);

  useEffect(() => {
    // Aquí puedes hacer otra solicitud al servidor para obtener más detalles sobre el inmueble si es necesario

    // Ejemplo de cómo podrías hacer otra solicitud
    fetch(`http://localhost:3001/verInmueble/${id}`)
      .then(response => response.json())
      .then(response => {
        setCasa(response);
      })
      .catch(error => console.error("Error", error));
  }, [id]);

  

  return (
    <div>
      <h2>Detalles del Inmueble</h2>
      <p>ID: {casa.idInmueble}</p>
    </div>
  );
}
